eval("__webpack_require__.r(__webpack_exports__);\n/* harmony export */ __webpack_require__.d(__webpack_exports__, {\n/* harmony export */   literatureData: () => (/* binding */ literatureData)\n/* harmony export */ });\nconst literatureData = [\n    {\n        id: 1,\n        title: \"The adoption of artificial intelligence in human resources management practices\",\n        authors: \"Nishad Nawaz, Hemalatha Arunachalam, Barani K. Pathi, Vijayakumar Gajenderan\",\n        year: \"2024\",\n        source: \"International Journal of Information Management Data Insights\",\n        category: \"hr\",\n        summary: \"This peer-reviewed article examines how AI impacts HR practices. The authors identify key areas where AI provides benefits, such as increased accuracy, personalization, and cost savings. Through a survey of 274 employees, the study finds that AI can significantly reduce time and costs in HR. The article also highlights that certain factors (e.g., computing power and precision) positively affect results, while others (e.g., real-time automation) did not have a significant effect.\",\n        keywords: [\n            \"HR\",\n            \"AI adoption\",\n            \"cost reduction\",\n            \"personalization\",\n            \"accuracy\"\n        ],\n        url: \"https://www.sciencedirect.com/\",\n        keyFindings: [\n            \"AI improves accuracy and personalization in HR processes\",\n            \"Survey of 274 employees shows significant time and cost reduction\",\n            \"Computing power and precision positively affect AI implementation results\",\n            \"Real-time automation did not show significant effect on outcomes\"\n        ]\n    },\n    {\n        id: 2,\n        title: \"The Role of Human Resources in Digital Transformation and Organizational Change Management\",\n        authors: \"Hamid Biouaraine, Nabil Ridoini\",\n        year: \"2024\",\n        source: \"International Journal of Economic Studies and Management\",\n        category: \"hr\",\n        summary: \"This study (a systematic literature review) focuses on HR's role in digital transformation. The authors highlight that digitalization of HR tasks provides competitive advantages but requires changes in work style and new HR competencies. The study shows that HR managers are often hesitant to adopt new technology, while emphasizing the need for digital skills and a comprehensive digital strategy in the organization. The article recommends that HR develop innovative strategies to support change processes and integrate AI, big data, and other technologies in HR planning.\",\n        keywords: [\n            \"HR\",\n            \"digital transformation\",\n            \"change management\",\n            \"digital skills\",\n            \"organizational strategy\"\n        ],\n        url: \"https://www.researchgate.net/\",\n        keyFindings: [\n            \"Digitalization of HR tasks provides competitive advantages\",\n            \"HR managers are often hesitant to adopt new technology\",\n            \"Digital skills and comprehensive strategy are essential\",\n            \"HR needs to develop innovative strategies for change processes\"\n        ]\n    },\n    {\n        id: 3,\n        title: \"How Generative AI Will Transform HR\",\n        authors: \"Julie Bedard et al.\",\n        year: \"2023\",\n        source: \"Boston Consulting Group\",\n        category: \"hr\",\n        summary: \"This industry report from Boston Consulting Group describes how generative AI can change the HR function. The authors note that HR has historically lagged in AI adoption, but generative AI is now dramatically accelerating interest. The report argues that AI will not replace HR, but rather make the HR role more efficient – for example, by automating administrative tasks and giving managers better insights. At the same time, the importance of ethical and responsible use of AI in HR is emphasized, as well as the need to train HR leaders in leveraging the technology.\",\n        keywords: [\n            \"HR\",\n            \"generative AI\",\n            \"efficiency\",\n            \"automation\",\n            \"ethical AI\"\n        ],\n        url: \"https://www.bcg.com/\",\n        keyFindings: [\n            \"HR has historically lagged in AI adoption\",\n            \"Generative AI is accelerating interest in AI for HR\",\n            \"AI will make HR more efficient rather than replace it\",\n            \"Ethical and responsible AI use is crucial in HR applications\"\n        ]\n    },\n    {\n        id: 4,\n        title: \"HR Adopts AI\",\n        authors: \"Roy Maurer\",\n        year: \"2024\",\n        source: \"Society for Human Resource Management\",\n        category: \"hr\",\n        summary: \"This article from the Society for Human Resource Management summarizes an HR survey on AI adoption in HR. It reports that approximately 25% of organizations already use AI in HR, and most of these started within the last year. Furthermore, almost 50% of HR professionals state that AI has become a much higher priority recently. The study shows that large businesses and the technology industry are leading in adoption, and ~30% of those using AI have invested in employee training to work with AI. HR leaders are optimistic: 61% believe effective use of AI can improve their own organization, and 56% think AI will improve collaboration. At the same time, many acknowledge the need for reskilling employees to meet changing competency requirements.\",\n        keywords: [\n            \"HR\",\n            \"AI adoption\",\n            \"survey\",\n            \"employee training\",\n            \"reskilling\"\n        ],\n        url: \"https://www.shrm.org/\",\n        keyFindings: [\n            \"25% of organizations already use AI in HR\",\n            \"50% of HR professionals say AI has become a higher priority\",\n            \"Large businesses and tech industry lead in adoption\",\n            \"61% of HR leaders believe AI can improve their organization\"\n        ]\n    },\n    {\n        id: 5,\n        title: \"The adoption of AI in HRM facilitates efficient recruiting\",\n        authors: \"M. Meshram\",\n        year: \"2023\",\n        source: \"Technology in Society\",\n        category: \"hr\",\n        summary: \"Recent research indicates that AI tools in HR can make it easier to find and attract highly qualified candidates, streamlining the recruitment process. The study suggests that AI-based systems can screen candidates faster and more accurately than traditional methods, helping organizations fill competency gaps more quickly. This is especially relevant in a labor market where the competition for talent is high.\",\n        keywords: [\n            \"HR\",\n            \"recruitment\",\n            \"AI tools\",\n            \"talent acquisition\",\n            \"screening\"\n        ],\n        url: \"https://www.sciencedirect.com/\",\n        keyFindings: [\n            \"AI tools streamline the recruitment process\",\n            \"AI-based systems screen candidates faster and more accurately\",\n            \"Organizations can fill competency gaps more quickly\",\n            \"Particularly valuable in competitive talent markets\"\n        ]\n    },\n    {\n        id: 6,\n        title: \"Leading in the Digital Age: The Role of Leadership in Organizational Digital Transformation\",\n        authors: \"António Sacavém et al.\",\n        year: \"2025\",\n        source: \"Administrative Sciences\",\n        category: \"leadership\",\n        summary: \"This peer-reviewed work (an integrative literature study) explores how leaders can best drive digital transformation. The study finds that effective leadership is crucial for integrating new technology into the organization and promoting learning, collaboration, and agility. By adapting leadership style to changes, leaders can reduce uncertainty and make better decisions in a digital context. The article concludes that 'digitally vigilant' leaders – who are able to use the right tools and create cohesion even in distributed teams – are key to ensuring that digital transformation increases motivation rather than weakening it.\",\n        keywords: [\n            \"leadership\",\n            \"digital transformation\",\n            \"organizational change\",\n            \"agility\",\n            \"distributed teams\"\n        ],\n        url: \"https://www.mdpi.com/\",\n        keyFindings: [\n            \"Effective leadership is crucial for integrating new technology\",\n            \"Adapting leadership style reduces uncertainty in digital contexts\",\n            \"'Digitally vigilant' leaders create cohesion in distributed teams\",\n            \"Proper leadership ensures digital transformation increases motivation\"\n        ]\n    },\n    {\n        id: 7,\n        title: \"Maneuvering of Digital Transformation: Role of AI in Empowering Leadership – An Empirical Overview\",\n        authors: \"Sabale A. Abasaheb, Rajagopal Subashini\",\n        year: \"2023\",\n        source: \"International Journal of Professional Business Review\",\n        category: \"leadership\",\n        summary: \"This study examines how AI can 'strengthen' leadership qualities and facilitate change management. The authors conducted a quantitative survey among 150 leaders who use AI tools in their work. The findings suggest that 'empowering leadership' – i.e., leadership that gives employees autonomy and promotes innovation – is particularly useful for navigating AI-driven changes. The study argues that AI implementation should be accompanied by a change management strategy that emphasizes training and cultural adaptation, so that the technology is actually adopted and accepted in the organization.\",\n        keywords: [\n            \"leadership\",\n            \"AI\",\n            \"empowerment\",\n            \"change management\",\n            \"cultural adaptation\"\n        ],\n        url: \"https://dialnet.unirioja.es/\",\n        keyFindings: [\n            \"AI can strengthen leadership qualities\",\n            \"'Empowering leadership' is effective for navigating AI-driven changes\",\n            \"AI implementation requires change management strategy\",\n            \"Training and cultural adaptation are essential for technology acceptance\"\n        ]\n    },\n    {\n        id: 8,\n        title: \"AI-First Leadership: Embracing the Future of Work\",\n        authors: \"Gregg Kober\",\n        year: \"2025\",\n        source: \"Harvard Business Publishing\",\n        category: \"leadership\",\n        summary: \"This white paper discusses how leaders must adapt to a future where AI is central. Kober argues that leaders must develop an 'AI-first' mindset – that is, actively looking for opportunities where humans and AI can collaborate to achieve strategic goals. He particularly highlights the role of middle managers in integrating AI into daily processes and bridging the gap between technology and business strategy. Furthermore, a structured program for leadership development in AI is outlined, including building basic AI knowledge, cultivating an innovative mindset, and ensuring that leaders feel confident using AI.\",\n        keywords: [\n            \"leadership\",\n            \"AI-first mindset\",\n            \"collaboration\",\n            \"middle managers\",\n            \"leadership development\"\n        ],\n        url: \"https://www.harvardbusiness.org/\",\n        keyFindings: [\n            \"Leaders need to develop an 'AI-first' mindset\",\n            \"Middle managers play key role in integrating AI into daily processes\",\n            \"Structured leadership development programs for AI are important\",\n            \"Leaders need to feel confident using AI technologies\"\n        ]\n    },\n    {\n        id: 9,\n        title: \"AI Product Management 2 Years In\",\n        authors: \"Marty Cagan\",\n        year: \"2024\",\n        source: \"Silicon Valley Product Group\",\n        category: \"leadership\",\n        summary: \"Although this post primarily deals with product management, it has important implications for leaders in general. Cagan – a recognized expert – points out that virtually all product managers going forward must understand AI and integrate it into their projects. He challenges the popular perception that AI will make the management role obsolete, and claims on the contrary that leaders' jobs become more demanding and critical in an AI-driven world. Leaders must navigate a more complex landscape where they balance human judgment with AI insights, requiring a stronger focus on ethics, employee engagement, and continuous learning.\",\n        keywords: [\n            \"leadership\",\n            \"product management\",\n            \"AI integration\",\n            \"ethics\",\n            \"continuous learning\"\n        ],\n        url: \"https://www.svpg.com/\",\n        keyFindings: [\n            \"Product managers must understand and integrate AI\",\n            \"AI will make leadership more demanding rather than obsolete\",\n            \"Leaders must balance human judgment with AI insights\",\n            \"Focus on ethics, employee engagement, and continuous learning is essential\"\n        ]\n    },\n    {\n        id: 10,\n        title: \"Artificial Intelligence in Supply Chain and Operations Management: A Multiple Case Study Research\",\n        authors: \"V. G. Cannas, M. P. Ciano, M. Saltalamacchia, R. Secchi\",\n        year: \"2023\",\n        source: \"International Journal of Production Research\",\n        category: \"operations\",\n        summary: \"This study highlights how AI can support processes in supply chain and operations. The researchers conducted case studies in six companies and found that AI use in operations reduced costs and lead times, and improved service levels, quality, and safety. At the same time, they uncovered barriers such as data quality, lack of competence, and unclear business benefits that can hinder successful implementation. The study concludes with practical guidelines for managers considering AI in operations: among other things, ensuring adequate training and starting with limited pilot projects before broad scaling.\",\n        keywords: [\n            \"operations\",\n            \"supply chain\",\n            \"AI implementation\",\n            \"cost reduction\",\n            \"service improvement\"\n        ],\n        url: \"https://nottingham-repository.worktribe.com/\",\n        keyFindings: [\n            \"AI in operations reduces costs and lead times\",\n            \"Service levels, quality, and safety are improved with AI\",\n            \"Barriers include data quality and lack of competence\",\n            \"Start with limited pilot projects before scaling\"\n        ]\n    },\n    {\n        id: 11,\n        title: \"Examining the integration of AI in supply chain management from Industry 4.0 to 6.0: a SLR\",\n        authors: \"Alexander Samuels\",\n        year: \"2025\",\n        source: \"Frontiers in Future Technologies\",\n        category: \"operations\",\n        summary: \"This systematic literature review examines the development of AI in supply chains and operations from Industry 4.0 to the visions of Industry 6.0. The findings show that AI provides significant improvements in demand forecasting, inventory management, and decision-making in the supply chain. In an Industry 5.0 context, it also emphasizes how human-AI collaboration can tailor solutions and solve problems more effectively. The study also emphasizes that AI can contribute to sustainable practices by optimizing resource use and reducing environmental footprint. At the same time, it points to challenges such as cybersecurity and competency gaps, which organizations must address to fully utilize AI.\",\n        keywords: [\n            \"operations\",\n            \"supply chain\",\n            \"Industry 4.0\",\n            \"Industry 5.0\",\n            \"human-AI collaboration\"\n        ],\n        url: \"https://www.ncbi.nlm.nih.gov/\",\n        keyFindings: [\n            \"AI improves demand forecasting and inventory management\",\n            \"Human-AI collaboration tailors solutions more effectively\",\n            \"AI contributes to sustainable practices\",\n            \"Challenges include cybersecurity and competency gaps\"\n        ]\n    },\n    {\n        id: 12,\n        title: \"Case Study: Amazon's AI-Driven Supply Chain – A Blueprint for the Future of Global Logistics\",\n        authors: \"Carsten Krause\",\n        year: \"2024\",\n        source: \"The CDO Times\",\n        category: \"operations\",\n        summary: \"This industry case study delves into how Amazon uses AI to streamline its complex logistics chain. Amazon uses machine learning to improve demand forecasts for millions of products and optimize the flow of goods from supplier to end customer. The article describes how AI-based forecasts and route optimization have reduced inventory costs and delivery times, while customer satisfaction has increased. It also highlights challenges Amazon faced with traditional methods at enormous scale, and how AI became the solution for handling the complexity. The case serves as a roadmap for other businesses looking to scale their operations through AI.\",\n        keywords: [\n            \"operations\",\n            \"supply chain\",\n            \"Amazon\",\n            \"logistics\",\n            \"machine learning\"\n        ],\n        url: \"https://www.cdotimes.com/\",\n        keyFindings: [\n            \"Amazon uses machine learning for demand forecasting\",\n            \"AI-based route optimization reduces costs and delivery times\",\n            \"Customer satisfaction increases with AI-driven logistics\",\n            \"AI solves complexity challenges at enormous scale\"\n        ]\n    },\n    {\n        id: 13,\n        title: \"New Accenture Research Finds that Companies with AI-Led Processes Outperform Peers\",\n        authors: \"Accenture\",\n        year: \"2024\",\n        source: \"Accenture\",\n        category: \"operations\",\n        summary: \"In this report, Accenture documents the impact of AI-driven operations across industries. The research found that the proportion of companies with fully modernized, AI-driven processes increased from 9% in 2023 to 16% in 2024. These 'forerunners' achieve on average 2.5 times higher revenue growth and 2.4 times higher productivity than others, and succeed 3.3 times more often in scaling up generative AI use cases. The report also points out that the majority of businesses (74%) have not yet managed to reap significant values from AI, often due to deficiencies in data foundation and competence. Accenture outlines four key actions to increase 'operational maturity' – including establishing strong data governance, investing in training/retraining employees, close collaboration between business and IT, and end-to-end process improvements with cloud technology and AI.\",\n        keywords: [\n            \"operations\",\n            \"AI-led processes\",\n            \"productivity\",\n            \"data governance\",\n            \"operational maturity\"\n        ],\n        url: \"https://www.accenture.com/\",\n        keyFindings: [\n            \"Companies with AI-driven processes show 2.5x higher revenue growth\",\n            \"16% of companies have fully modernized, AI-driven processes\",\n            \"74% of businesses haven't yet reaped significant value from AI\",\n            \"Key actions include data governance and employee training\"\n        ]\n    },\n    {\n        id: 14,\n        title: \"The paradoxes of generative AI-enabled customer service: A guide for managers\",\n        authors: \"Carla Ferraro, Vlad Demsar, Sean Sands et al.\",\n        year: \"2024\",\n        source: \"Business Horizons\",\n        category: \"customer-service\",\n        summary: \"In this peer-reviewed article, the authors identify six paradoxes that arise when customer service uses generative AI. Among these are that customers may feel 'more connected, yet isolated' and get 'higher quality, but less empathy'. Chatbots can drastically increase efficiency (e.g., handle more inquiries faster), but at the same time there is a risk of frustration if they lack human warmth. For each paradoxical effect, the article outlines strategies for managing the disadvantages – for example, by keeping humans involved in critical decisions and monitoring the fairness of AI solutions. The study provides managers with a framework for balanced use of generative AI in customer service, so that they can reap the benefits (such as 50% productivity increase for chatbots mentioned in the text) without sacrificing customer trust.\",\n        keywords: [\n            \"customer service\",\n            \"generative AI\",\n            \"chatbots\",\n            \"efficiency\",\n            \"customer trust\"\n        ],\n        url: \"https://doi.org/\",\n        keyFindings: [\n            \"Six paradoxes arise when customer service uses generative AI\",\n            \"Chatbots increase efficiency but may lack human warmth\",\n            \"Keeping humans involved in critical decisions is important\",\n            \"Balanced approach can achieve benefits without sacrificing trust\"\n        ]\n    },\n    {\n        id: 15,\n        title: \"Serving customers through chatbots: positive and negative effects on customer experience\",\n        authors: \"Angelo Ranieri, Irene Di Bernardo, Cristina Mele\",\n        year: \"2024\",\n        source: \"Journal of Service Theory and Practice\",\n        category: \"customer-service\",\n        summary: \"This study examines the effects of introducing a chatbot at an online retailer over a two-year period. Through analysis of 7,167 customer dialogues, seven themes that affect customer experience are uncovered, e.g., interaction quality, information gathering, task mastery, and digital trust. The results show a mixed picture: On the positive side, customers experienced faster and more pleasant interactions, better information access, and reduced 'shopping stress'. On the negative side, there are also reports of frustration – e.g., when the chatbot gave confusing answers or didn't follow procedures – which led some customers to abandon the purchase journey. The study provides a nuanced understanding of the 'light and dark' sides of chatbots, and suggests a framework for how companies can maximize positive outcomes (e.g., pleasant interaction, quick problem solving) and minimize negative ones (such as dissatisfaction and breach of trust) through good design and monitoring of chatbot services.\",\n        keywords: [\n            \"customer service\",\n            \"chatbots\",\n            \"customer experience\",\n            \"interaction quality\",\n            \"digital trust\"\n        ],\n        url: \"https://www.emerald.com/\",\n        keyFindings: [\n            \"Analysis of 7,167 customer dialogues reveals seven key themes\",\n            \"Positive effects include faster interactions and better information access\",\n            \"Negative effects include frustration with confusing answers\",\n            \"Good design and monitoring can maximize positive outcomes\"\n        ]\n    },\n    {\n        id: 16,\n        title: \"Exploring AI-Powered Chatbots for Customer Service Enhancement\",\n        authors: \"Potter Kaledio, Lucas Doris\",\n        year: \"2024\",\n        source: \"SSRN\",\n        category: \"customer-service\",\n        summary: \"This review article summarizes how AI-powered chatbots improve customer service efficiency and scalability. Chatbots with NLP can handle routine inquiries around the clock, freeing up human customer service representatives for more complex tasks and significantly reducing response time. The authors point out that chatbots can also provide personalized responses by analyzing customer data, which in turn increases customer satisfaction. At the same time, challenges such as the need for seamless transitions to human support when the bot falls short, as well as privacy issues when using customer information, are discussed. The conclusion is that AI chatbots can strengthen loyalty and streamline processes cost-effectively, but success requires careful planning, ongoing optimization, and a balanced combination of automation and human empathy.\",\n        keywords: [\n            \"customer service\",\n            \"chatbots\",\n            \"NLP\",\n            \"personalization\",\n            \"human support\"\n        ],\n        url: \"https://www.ssrn.com/\",\n        keyFindings: [\n            \"Chatbots with NLP handle routine inquiries 24/7\",\n            \"Human representatives are freed for more complex tasks\",\n            \"Personalized responses increase customer satisfaction\",\n            \"Success requires planning and balanced automation-human approach\"\n        ]\n    },\n    {\n        id: 17,\n        title: \"Salesforce State of Service Report\",\n        authors: \"Salesforce\",\n        year: \"2023\",\n        source: \"Plivo\",\n        category: \"customer-service\",\n        summary: \"A global survey among customer service decision-makers shows an overwhelmingly positive attitude toward AI. Fully 95% of leaders in companies that already use AI report reduced costs and time spent, and 92% believe generative AI improves customer service. Furthermore, 83% of these companies plan to increase investments in AI in the next year. A related finding from IBM shows that 74% of executives expect AI to fundamentally change the way they approach customer experience, and just as many believe AI will affect customers' perception of their brand. These figures underscore how critical AI is considered for the future of customer service, while also implying that most leaders are experiencing concrete benefits in terms of efficiency and improved customer experience already today.\",\n        keywords: [\n            \"customer service\",\n            \"AI adoption\",\n            \"cost reduction\",\n            \"customer experience\",\n            \"brand perception\"\n        ],\n        url: \"https://www.plivo.com/\",\n        keyFindings: [\n            \"95% of leaders report reduced costs and time with AI\",\n            \"92% believe generative AI improves customer service\",\n            \"83% plan to increase AI investments next year\",\n            \"74% expect AI to fundamentally change customer experience approach\"\n        ]\n    },\n    {\n        id: 18,\n        title: \"The Artificial Intelligence Revolution in New-Product Development\",\n        authors: \"Robert G. Cooper\",\n        year: \"2023\",\n        source: \"Stage-Gate Institute\",\n        category: \"product-management\",\n        summary: \"Product innovation expert Cooper describes how leading companies are already using AI to halve development time for new products. He provides a broad review of AI applications throughout the innovation journey – from the idea phase to after launch. The report shares concrete examples: Unilever has a fully automated robot laboratory to develop and test new formulas, Nestlé uses an 'AI concept generator' that scans data and suggests new product ideas, and pharmaceutical company Moderna used AI tools at record speed to develop the mRNA vaccine. Cooper argues that such initiatives should not be standalone projects, but part of a holistic transformation led from top management. AI is described as a 'milestone' that will change product development more than anything since digital CAD in the 1960s – with the main benefit being increased innovation degree and accuracy in an otherwise risky NPD journey.\",\n        keywords: [\n            \"product management\",\n            \"innovation\",\n            \"AI applications\",\n            \"development time\",\n            \"NPD\"\n        ],\n        url: \"https://www.stage-gate.com/\",\n        keyFindings: [\n            \"Leading companies use AI to halve product development time\",\n            \"Examples include Unilever's robot lab and Nestlé's concept generator\",\n            \"AI initiatives should be part of holistic transformation\",\n            \"AI increases innovation degree and accuracy in NPD\"\n        ]\n    },\n    {\n        id: 19,\n        title: \"How generative AI could accelerate software product time to market\",\n        authors: \"Chandra Gnanasambandam, Martin Harrysson, Rikki Singh, Chaitra Yarlagadda\",\n        year: \"2024\",\n        source: \"McKinsey & Co\",\n        category: \"product-management\",\n        summary: \"This article presents a study where 40 product managers participated in an experiment to measure the effect of generative AI on key product management tasks. Participants were divided into groups that solved typical tasks (market research, requirements specification, backlog prioritization, etc.) either with specialized AI tools, with general AI (ChatGPT), or without AI. Preliminary findings show that the groups with AI support completed the tasks significantly faster – AI could cut down the execution time for certain phases considerably, without the quality of deliverables deteriorating. Product managers also reported that the AI aids improved the work experience on repetitive tasks. The McKinsey team further found that the most experienced PMs derived the greatest benefit from AI, probably because they were better able to integrate AI output with their own domain expertise. The article suggests that generative AI can 'rewire' the product development process to achieve faster customer value, but emphasizes the need for training PMs in using these tools effectively and responsibly.\",\n        keywords: [\n            \"product management\",\n            \"generative AI\",\n            \"time to market\",\n            \"efficiency\",\n            \"domain expertise\"\n        ],\n        url: \"https://www.mckinsey.com/\",\n        keyFindings: [\n            \"Groups with AI support completed tasks significantly faster\",\n            \"Quality of deliverables did not deteriorate with AI\",\n            \"Experienced PMs derived greatest benefit from AI\",\n            \"Training is needed for effective and responsible AI use\"\n        ]\n    },\n    {\n        id: 20,\n        title: \"When Generative AI Meets Product Development\",\n        authors: \"Tucker J. Marion, Mahdi Srour, Frank Piller\",\n        year: \"2024\",\n        source: \"MIT Sloan Management Review\",\n        category: \"product-management\",\n        summary: \"This article shares insight into how large language models (LLM) and generative AI are changing the way new products are designed and tested. The authors describe three main areas where GenAI is used: (1) Idea development and design: Companies like design agency Loft use GPT-4 to suggest new product features based on customer preferences, and tools like Midjourney to generate concept sketches. (2) Engineering design: Although generative AI can help with prototype ideas, trust in the tools is crucial – in the Loft example, they chose to pause AI use during the actual construction to ensure reliability. (3) User testing and analysis: After prototyping, the team used AI to transcribe and analyze feedback from video tests with customers, where ChatGPT summarized input and identified areas for improvement. The article illustrates that generative AI can increase the pace and scope of idea exploration, make iterations faster and more data-driven, but that humans still need to assess the realism of the ideas (e.g., filter out 'hallucinations' that are not practically feasible).\",\n        keywords: [\n            \"product management\",\n            \"generative AI\",\n            \"product development\",\n            \"idea exploration\",\n            \"user testing\"\n        ],\n        url: \"https://sloanreview.mit.edu/\",\n        keyFindings: [\n            \"GenAI is used in idea development, engineering design, and user testing\",\n            \"AI increases pace and scope of idea exploration\",\n            \"Trust in tools is crucial during engineering design\",\n            \"Humans must assess realism and filter out 'hallucinations'\"\n        ]\n    },\n    {\n        id: 21,\n        title: \"AI Product Management: Virtually all PMs will need to be AI PMs\",\n        authors: \"Marty Cagan\",\n        year: \"2024\",\n        source: \"Silicon Valley Product Group\",\n        category: \"product-management\",\n        summary: \"Product management guru Marty Cagan argues that generative AI is becoming a core component in product development, and that product managers going forward must master AI to succeed. In his blog post at the end of 2024, he reflects on how hype versus reality has played out: Despite a 'dizzying' amount of news about AI, fundamental product management principles have endured – but with a twist. AI allows product managers to iterate faster, but Cagan points out that the role becomes more demanding, not less: PMs must now handle AI tools, evaluate algorithmic decisions, and still be accountable for product success. He warns against believing that AI automates away the PM job; rather, PMs must ensure that AI is used in a way that improves user experience and value, while also addressing new challenges such as AI ethics and model errors. The post is a clear call for competence building: future product managers need technological understanding in the AI area to remain effective 'mini-CEOs' for their products.\",\n        keywords: [\n            \"product management\",\n            \"generative AI\",\n            \"product managers\",\n            \"AI ethics\",\n            \"competence building\"\n        ],\n        url: \"https://www.svpg.com/\",\n        keyFindings: [\n            \"Generative AI is becoming a core component in product development\",\n            \"Product managers must master AI to succeed\",\n            \"The PM role becomes more demanding, not less\",\n            \"PMs must address AI ethics and model errors\"\n        ]\n    },\n    {\n        id: 22,\n        title: \"Adapting change management strategies for the AI Era: Lessons from large-scale IT integrations\",\n        authors: \"Maicon R. Martins\",\n        year: \"2023\",\n        source: \"World Journal of Advanced Research and Reviews\",\n        category: \"organizational-change\",\n        summary: \"This article discusses how classical change management principles must be adapted when organizations adopt AI technologies. Based on experiences from large IT implementations, Martins emphasizes that clear top-down communication and stakeholder involvement are at least as important in AI introductions as in previous IT projects. At the same time, AI requires an even more nuanced change management approach: The technology evolves rapidly and can profoundly affect work processes, so leaders must address cultural shifts, ethical considerations, and the need for continuous learning among employees. The article suggests drawing lessons from successes and failures in large IT integrations – e.g., the importance of training and pilot testing – and illustrates this with a hypothetical case where a bank introduces AI. The conclusion is a 'best practice' checklist for change management in the AI age, which emphasizes that change management is a critical driver for innovation and growth when new technology is to be adopted.\",\n        keywords: [\n            \"organizational change\",\n            \"change management\",\n            \"AI adoption\",\n            \"stakeholder involvement\",\n            \"continuous learning\"\n        ],\n        url: \"https://www.wjarr.com/\",\n        keyFindings: [\n            \"Clear top-down communication is crucial for AI adoption\",\n            \"AI requires nuanced change management approach\",\n            \"Cultural shifts and ethical considerations must be addressed\",\n            \"Change management is a critical driver for innovation\"\n        ]\n    },\n    {\n        id: 23,\n        title: \"Digital Transformation and Change Management: Impact of AI and Big Data on Organizational Performance\",\n        authors: \"Yesa C. Ramadhani, Dian A. Utami\",\n        year: \"2025\",\n        source: \"Maneggio Journal\",\n        category: \"organizational-change\",\n        summary: \"This qualitative study (with case and literature review) finds that AI and big data initiatives can improve efficiency, decision precision, and innovation in businesses, but that success depends strongly on the organization's change readiness. The authors observe that technological implementation often faces challenges such as employee resistance to change, inadequate IT infrastructure, and concerns around data security. Effective change management – with visionary leadership, good communication, and training measures – is identified as a key factor in overcoming these obstacles. Organizations that succeeded with AI rollout often had top executives who actively supported the initiative and invested in competence building among employees. The study concludes that AI and digital transformation can provide great benefits, but only if people and culture develop in step with the technology – a clear call to integrate change management strategies in all digital transformation projects.\",\n        keywords: [\n            \"organizational change\",\n            \"digital transformation\",\n            \"change readiness\",\n            \"employee resistance\",\n            \"change management\"\n        ],\n        url: \"https://www.researchgate.net/\",\n        keyFindings: [\n            \"AI initiatives improve efficiency and decision precision\",\n            \"Success depends on organization's change readiness\",\n            \"Challenges include employee resistance and inadequate infrastructure\",\n            \"Effective change management is key to overcoming obstacles\"\n        ]\n    },\n    {\n        id: 24,\n        title: \"Rewired and running ahead: Digital and AI leaders are leaving the rest behind\",\n        authors: \"Bryce Hall, Eric Lamarre, Rob Levin, J.-T. Lorenz, Pamela Simon\",\n        year: \"2024\",\n        source: \"McKinsey & Company\",\n        category: \"organizational-change\",\n        summary: \"McKinsey presents research findings showing an increasing performance gap between companies that are digital/AI leaders and those lagging behind. In the period 2020-22, the total shareholder return (TSR) for digital/AI leaders was 2-6 times higher than for laggards across sectors. The report explains that these leaders have developed strong digital capabilities and change practices that create 'compounding' competitive advantages over time. In contrast, previous surveys show that the average company only extracts less than a third of expected value from its digital transformations. McKinsey points out that the leading companies are characterized by holistic integration of technology in core processes, as well as good change management and competence development. The message is that organizations must 'rewire' to avoid being left behind – which involves investing in people, processes, and culture in addition to technology.\",\n        keywords: [\n            \"organizational change\",\n            \"digital transformation\",\n            \"AI leaders\",\n            \"competitive advantage\",\n            \"change management\"\n        ],\n        url: \"https://www.mckinsey.com/\",\n        keyFindings: [\n            \"Digital/AI leaders show 2-6 times higher shareholder return\",\n            \"Leaders create 'compounding' competitive advantages\",\n            \"Average company extracts less than a third of expected value\",\n            \"Success requires investing in people, processes, and culture\"\n        ]\n    },\n    {\n        id: 25,\n        title: \"Reskilling in the Age of AI\",\n        authors: \"Jorge Tamayo, Leila Doumi, Sagar Goel, Orsolya Kovács-Ondrejkovic, Raffaella Sadun\",\n        year: \"2023\",\n        source: \"Harvard Business Review\",\n        category: \"organizational-change\",\n        summary: \"This HBR award-winning article examines how leading businesses globally are conducting large-scale reskilling of employees in the face of AI-driven change. Based on interviews with leaders in around 40 organizations, the authors identify five paradigm shifts in the approach to training and competence: Among other things, that reskilling is now considered a continuous responsibility at all leadership levels, that it is increasingly integrated as a strategic part of business management (not just HR measures), and that many companies create internal 'academies' or partnerships to offer relevant training in new skills. The article provides practical examples – for instance, how one company let employees 'shadow' AI systems and learn from them, while another used internal apprenticeship programs – and highlights that the most successful reskilling initiatives also focus on culture: promoting a learning culture where employees don't fear AI, but see opportunities. The main message is that reskilling is a critical part of change management in the AI age, and that those who succeed think differently about who, what, and how to learn in step with technological development.\",\n        keywords: [\n            \"organizational change\",\n            \"reskilling\",\n            \"AI-driven change\",\n            \"learning culture\",\n            \"competence development\"\n        ],\n        url: \"https://hbr.org/\",\n        keyFindings: [\n            \"Five paradigm shifts in approach to training and competence\",\n            \"Reskilling is a continuous responsibility at all leadership levels\",\n            \"Companies create internal 'academies' for relevant training\",\n            \"Successful initiatives promote a learning culture\"\n        ]\n    },\n    {\n        id: 26,\n        title: \"The state of AI in early 2024: Gen AI adoption spikes and starts to generate value\",\n        authors: \"Alex Singla, Alexander Sukharevsky, Lareina Yee, Michael Chui et al.\",\n        year: \"2024\",\n        source: \"McKinsey Global Survey\",\n        category: \"digital-transformation\",\n        summary: \"McKinsey's latest annual AI survey shows a dramatic increase in the prevalence of AI across businesses. 65% of respondents say that the organization now uses generative AI regularly – almost doubling from the previous year. Total AI adoption level (including all types of AI) has jumped to 72% in 2024, after hovering around 50% for several years. The survey also indicates that AI is now being used in more parts of the business: Half of companies use AI in at least two business functions, up from a third the year before. This is largely due to the genAI boom. Furthermore, the majority of companies report material benefits: those that have implemented genAI see both cost reductions and increased revenue in the departments where the technology has been adopted. At the same time, awareness of risk has increased – more businesses have begun to mitigate e.g., inaccuracy and bias – but McKinsey points out that there is still a way to go: less than half have measures for even the most relevant risks. All in all, the report signals that 2024 marks the transition from experimentation to value extraction for AI, with a small core of 'high-performing' companies leading the way.\",\n        keywords: [\n            \"digital transformation\",\n            \"AI adoption\",\n            \"generative AI\",\n            \"value extraction\",\n            \"risk awareness\"\n        ],\n        url: \"https://www.mckinsey.com/\",\n        keyFindings: [\n            \"65% of organizations use generative AI regularly\",\n            \"Total AI adoption level jumped to 72% in 2024\",\n            \"Half of companies use AI in at least two business functions\",\n            \"Majority report material benefits including cost reductions\"\n        ]\n    },\n    {\n        id: 27,\n        title: \"Generative AI: State of Enterprise adoption 2024\",\n        authors: \"Deloitte\",\n        year: \"2024\",\n        source: \"Deloitte Digital\",\n        category: \"digital-transformation\",\n        summary: \"This global survey focuses on the use of generative AI in larger companies. A key finding is that almost all organizations with advanced genAI initiatives experience positive returns: 74% say that their most advanced genAI measures meet or exceed ROI expectations. About 20% report an ROI over 30%. The report also shows that the most tested genAI solutions so far are in IT (e.g., code help, IT support), but that many industries are now pushing AI into core areas for competitive advantage – e.g., marketing in the consumer sector, operations in the industrial sector, R&D in pharmaceuticals, etc., instead of just general functions. Deloitte notes that leaders are realistic: over half expect it will take more than a year to solve challenges around benefit realization, adoption, governance, training, and trust for genAI projects. Nevertheless, the will is strong – 76% say they are willing to give the initiative at least 12 months more investment even if value targets are not immediately met. The message is that while 'everyone' is now trying genAI and seeing promising results, one must be patient and systematic to scale successfully.\",\n        keywords: [\n            \"digital transformation\",\n            \"generative AI\",\n            \"enterprise adoption\",\n            \"ROI\",\n            \"scaling\"\n        ],\n        url: \"https://www.deloitte.com/\",\n        keyFindings: [\n            \"74% say genAI initiatives meet or exceed ROI expectations\",\n            \"20% report ROI over 30%\",\n            \"Most tested solutions are in IT, but expanding to core areas\",\n            \"76% willing to invest for at least 12 more months\"\n        ]\n    },\n    {\n        id: 28,\n        title: \"Why we need to care about responsible AI in the age of the algorithm\",\n        authors: \"Ayesha Gulley\",\n        year: \"2023\",\n        source: \"World Economic Forum\",\n        category: \"digital-transformation\",\n        summary: \"This op-ed argues that responsible AI should be integrated into all digital transformation initiatives. Gulley points out that AI potentially can increase global GDP by $15.7 trillion by 2030, but warns that 'with great power comes great responsibility' – algorithms can introduce biases, errors, and injustices if used uncritically. The article mentions that organizations worldwide, from technology companies to the OECD, have already formulated principles for responsible AI. At the same time, regulatory requirements are tightening: The EU is close to adopting its AI regulation (AI Act), which will affect businesses globally by requiring risk assessments and transparency. For businesses, this means that proactive investment in responsible AI – which encompasses ethics, morality, and legislation – is not only social responsibility, but also necessary to remain competitive and avoid liability in the future. This article thus puts the 'soft side' of digital transformation in focus, by reminding that technological progress must be accompanied by governance and values.\",\n        keywords: [\n            \"digital transformation\",\n            \"responsible AI\",\n            \"ethics\",\n            \"regulation\",\n            \"governance\"\n        ],\n        url: \"https://www.weforum.org/\",\n        keyFindings: [\n            \"AI could increase global GDP by $15.7 trillion by 2030\",\n            \"Algorithms can introduce biases if used uncritically\",\n            \"EU's AI Act will require risk assessments and transparency\",\n            \"Responsible AI is necessary for competitiveness and liability avoidance\"\n        ]\n    },\n    {\n        id: 29,\n        title: \"AI Ethics at Unilever: From Policy to Process\",\n        authors: \"Thomas H. Davenport, Randy Bean\",\n        year: \"2023\",\n        source: \"MIT Sloan Management Review\",\n        category: \"data-ethics\",\n        summary: \"This case article describes how Unilever translates AI ethics principles into practical processes. Unilever established early a set of ethical AI guidelines – for example, a policy that 'no decision with major impact on individuals should be fully automated'. To operationalize this, they have introduced an AI Assurance process: Each new AI application is risk-assessed for ethical and efficiency hazards before rollout. The company's cross-disciplinary committee (including legal, HR, data/technology) evaluates the use case, and external experts are brought in for complex cases. Typical assessment criteria include explainability, robustness, bias, and privacy. When needed, 'human in the loop' is set – e.g., they decided that CV selection should not be left 100% to the algorithm without human control. The article also tells that Unilever collaborates with the startup Holistic AI to benchmark and improve these processes over time, and is preparing for the requirements in the EU's upcoming AI legislation. The Unilever case illustrates how a global company proactively builds data ethics into its innovation model, rather than waiting for regulatory pressure.\",\n        keywords: [\n            \"data ethics\",\n            \"AI ethics\",\n            \"policy\",\n            \"process\",\n            \"human in the loop\"\n        ],\n        url: \"https://sloanreview.mit.edu/\",\n        keyFindings: [\n            \"Unilever established ethical AI guidelines early\",\n            \"AI Assurance process evaluates each new AI application\",\n            \"Cross-disciplinary committee assesses use cases\",\n            \"Human control is maintained for high-impact decisions\"\n        ]\n    },\n    {\n        id: 30,\n        title: \"AI and ethics in business: A comprehensive review of responsible AI practices and corporate responsibility\",\n        authors: \"Funmilola O. Olatoye, Kehinde F. Awonuga, Noluthando Z. Mhlongo, Chidera V. Ibeh\",\n        year: \"2024\",\n        source: \"ResearchGate preprint\",\n        category: \"data-ethics\",\n        summary: \"This comprehensive literature review covers the intersection between AI and ethics in businesses. The authors highlight several key dimensions: Transparency – businesses must ensure that AI decisions are understandable and verifiable to build trust. Fairness and bias – the study points out the importance of diverse datasets and awareness of algorithmic bias to avoid discriminatory outcomes. It also addresses the broader socio-economic consequences: Business AI strategies should consider effects on employment, inequality, and accessibility. Furthermore, privacy and data security are emphasized as an ethical imperative – when companies collect enormous amounts of data, they must protect individuals' privacy to maintain trust. The recommendation is that responsible AI must be integrated into companies' CSR frameworks: Through openness, fairness, and good data practices, organizations can navigate the complex AI landscape in a way that benefits both the business and society. This review serves as an insightful 'checklist' for managers who want to ensure that their AI initiatives are ethically sound.\",\n        keywords: [\n            \"data ethics\",\n            \"responsible AI\",\n            \"transparency\",\n            \"fairness\",\n            \"privacy\"\n        ],\n        url: \"https://www.researchgate.net/\",\n        keyFindings: [\n            \"Transparency is essential for building trust in AI\",\n            \"Diverse datasets help avoid discriminatory outcomes\",\n            \"AI strategies should consider socio-economic consequences\",\n            \"Privacy protection is an ethical imperative\"\n        ]\n    },\n    {\n        id: 31,\n        title: \"AI Bias in Recruitment: Ethical Implications and Transparency\",\n        authors: \"Forbes Technology Council\",\n        year: \"2023\",\n        source: \"Forbes\",\n        category: \"data-ethics\",\n        summary: \"This article (from an industry perspective) highlights the risk of bias in AI-driven recruitment tools. It refers, among other things, to a well-known example at Amazon, where an experimental AI for CV screening turned out to favor male candidates for technical positions – an unintended effect of the algorithm learning from historical data characterized by gender biases. The result was that Amazon had to scrap the project to avoid discrimination. The Forbes article argues that such incidents illustrate the need to build in transparency and fairness controls in HR AI: algorithms must be explained and tested for bias before being put to use. Furthermore, a combined approach is encouraged where AI is used as support, but where humans still make final decisions in hiring processes to maintain ethical judgment. This case is a reminder that without conscious governance, AI can reinforce biases rather than eliminate them – which can harm both the company's reputation and diversity goals.\",\n        keywords: [\n            \"data ethics\",\n            \"AI bias\",\n            \"recruitment\",\n            \"transparency\",\n            \"fairness\"\n        ],\n        url: \"https://www.forbes.com/\",\n        keyFindings: [\n            \"Amazon's AI recruitment tool favored male candidates\",\n            \"Historical data can perpetuate gender biases\",\n            \"Transparency and fairness controls are essential\",\n            \"Human judgment should complement AI in hiring decisions\"\n        ]\n    },\n    {\n        id: 32,\n        title: \"EU Artificial Intelligence Act – Business Implications\",\n        authors: \"EY\",\n        year: \"2024\",\n        source: \"EY\",\n        category: \"data-ethics\",\n        summary: \"The EU's groundbreaking AI regulation is expected to be adopted in 2024 and will phase in comprehensive requirements affecting businesses globally. EY summarizes that the AI Act introduces a risk-based framework: 'High-risk' AI systems (e.g., in recruitment, credit scoring, health) must meet strict requirements for data management, documentation, transparency, and human oversight. For companies, this means new compliance costs and the need to adapt AI development processes. The law's effects span broadly – for example, prohibitions on certain practices (such as social scoring and manipulative AI) will take effect shortly after the law formally enters into force. Large multinational players like Unilever have already indicated that they will adopt the EU's requirements globally for their AI systems, just as GDPR became a global standard. This upcoming regulation anchors data ethics in law, and forces that responsible AI is no longer just 'best practice' but a legal requirement. Leaders must therefore understand the AI Act and begin preparing the organization (through mapping AI use, establishing governance routines, etc.) to avoid fines and reputational damage when the rules take effect in 2025-2026.\",\n        keywords: [\n            \"data ethics\",\n            \"AI regulation\",\n            \"compliance\",\n            \"risk-based framework\",\n            \"governance\"\n        ],\n        url: \"https://www.ey.com/\",\n        keyFindings: [\n            \"EU's AI Act introduces risk-based framework\",\n            \"'High-risk' AI systems face strict requirements\",\n            \"Prohibitions on certain practices will take effect quickly\",\n            \"Companies must prepare to avoid fines and reputational damage\"\n        ]\n    }\n];\n//# sourceURL=[module]\n//# sourceMappingURL=data:application/json;charset=utf-8;base64,\n//# sourceURL=webpack-internal:///(ssr)/./data/literature-data.ts\n");

